import{appData}from"./auth.js";export const calculation=()=>{let a=$("#calculation-summ");$("#calculation-range-summ").ionRangeSlider({min:appData.creditMin,max:appData.creditMax,step:appData.creditStep,onStart:function(t){a.prop("value",t.from+" грн")},onChange:function(t){a.prop("value",t.from+" грн")},hide_min_max:!0,hide_from_to:!0})};